(160201, '745D2BCC-3088-4440-BC03-5D315ABF94FA', 'The song I''m working on is called Storage Space. This is what I have so far....what I do while waiting in the parking lot for soccer games to start  I was searching through my storage space Looking for r crumbs illustrated Genesis  All the boxes were unlabeled  I had no intention to Become a tea time archeologist I found your Lego Eiffel Tower In 2 gallon Ziplock bags  that never made It to Craig''s list  Despite the $800 price tag Found the matching  kid carrier packs When I would hike with you on my back I guess I could save it a few more years  With the other toddler era artifacts The box of Halloween costumes, Ninja turtles and the incredibles Sort the candy on the carpet  taxonomies, kilocalories and inedibles  I want to pass it on Give it away  I could just haul it to the street  A cardboard sign that says ''free'' I''m not sure if I''m saving for you or for me  I read about this Japanese method  To help make sense of what I''m storing Should I Treat it Like a memory palace Or a memory crematorium So I take the hitchhikers guide to the Galaxy And the framed ''Beatles bijou''  Beatle faces are melting but Ringo will keep his eye on you', '481428551000000000', '481428621000000000', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'None', 'David', '2016-04-03T19:09:11'),
